import React, { useState } from 'react';
import {
  Container, Typography, TextField, Button, Grid, Paper, Snackbar, IconButton
} from '@mui/material';
import ContentCopyIcon from '@mui/icons-material/ContentCopy';
import CloseIcon from '@mui/icons-material/Close';

const ShortenPage = () => {
  const [urls, setUrls] = useState([{ longUrl: '', validity: '', shortcode: '' }]);
  const [shortenedResults, setShortenedResults] = useState([]);
  const [copied, setCopied] = useState(null);

  const handleChange = (index, field, value) => {
    const newUrls = [...urls];
    newUrls[index][field] = value;
    setUrls(newUrls);
  };

  const addUrlInput = () => {
    if (urls.length < 5) {
      setUrls([...urls, { longUrl: '', validity: '', shortcode: '' }]);
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    for (let i = 0; i < urls.length; i++) {
      const { longUrl, validity, shortcode } = urls[i];
      const urlPattern = /^(https?:\/\/)[\w.-]+\.[a-z]{2,}.*$/i;

      if (!urlPattern.test(longUrl)) {
        alert(`Row ${i + 1}: Please enter a valid long URL`);
        return;
      }

      if (validity && (!Number.isInteger(+validity) || +validity <= 0)) {
        alert(`Row ${i + 1}: Validity must be a positive integer`);
        return;
      }

      if (shortcode && !/^[a-zA-Z0-9_-]{3,10}$/.test(shortcode)) {
        alert(`Row ${i + 1}: Shortcode must be 3-10 characters (alphanumeric, -, _)`);
        return;
      }
    }

    // Simulated backend response (replace this with API call later)
    const results = urls.map((url) => ({
      ...url,
      shortUrl: `http://localhost:3000/${url.shortcode || Math.random().toString(36).substring(7)}`
    }));
    setShortenedResults(results);
  };

  const handleCopy = (url) => {
    navigator.clipboard.writeText(url);
    setCopied(url);
  };

  const handleCloseSnackbar = () => {
    setCopied(null);
  };

  return (
    <Container maxWidth="md" sx={{ mt: 4 }}>
      <Typography variant="h4" gutterBottom>URL Shortener</Typography>

      <form onSubmit={handleSubmit}>
        {urls.map((url, index) => (
          <Paper elevation={3} sx={{ p: 2, mb: 2 }} key={index}>
            <Grid container spacing={2}>
              <Grid item xs={12} md={6}>
                <TextField
                  fullWidth
                  label="Original Long URL"
                  value={url.longUrl}
                  onChange={(e) => handleChange(index, 'longUrl', e.target.value)}
                  required
                />
              </Grid>
              <Grid item xs={12} md={3}>
                <TextField
                  fullWidth
                  label="Validity (mins)"
                  type="number"
                  value={url.validity}
                  onChange={(e) => handleChange(index, 'validity', e.target.value)}
                />
              </Grid>
              <Grid item xs={12} md={3}>
                <TextField
                  fullWidth
                  label="Custom Shortcode"
                  value={url.shortcode}
                  onChange={(e) => handleChange(index, 'shortcode', e.target.value)}
                />
              </Grid>
            </Grid>
          </Paper>
        ))}

        {urls.length < 5 && (
          <Button variant="outlined" onClick={addUrlInput} sx={{ mb: 2 }}>
            + Add Another URL
          </Button>
        )}

        <Button type="submit" variant="contained" color="primary">
          Shorten URLs
        </Button>
      </form>

      {shortenedResults.length > 0 && (
        <div style={{ marginTop: '2rem' }}>
          <Typography variant="h5">Shortened URLs:</Typography>
          {shortenedResults.map((item, index) => (
            <Paper key={index} sx={{ p: 2, mt: 2 }}>
              <Typography>
                <strong>Original:</strong> {item.longUrl}
              </Typography>
              <Typography>
                <strong>Short URL:</strong>{' '}
                <a href={item.shortUrl} target="_blank" rel="noopener noreferrer">
                  {item.shortUrl}
                </a>
                <IconButton onClick={() => handleCopy(item.shortUrl)} size="small">
                  <ContentCopyIcon fontSize="small" />
                </IconButton>
              </Typography>
            </Paper>
          ))}
        </div>
      )}

      <Snackbar
        open={Boolean(copied)}
        autoHideDuration={2000}
        onClose={handleCloseSnackbar}
        message={`Copied: ${copied}`}
        action={
          <IconButton size="small" color="inherit" onClick={handleCloseSnackbar}>
            <CloseIcon fontSize="small" />
          </IconButton>
        }
      />
    </Container>
  );
};

export default ShortenPage;
